function getnamefromstart($str,$names){
    $_str = '';
    $result = [];
    
    for($i=0; $i<strlen($str); $i++){
        $_str .= $str[$i];
        
        
        
        if(strlen($_str) > 2){
            if(in_array($_str, $names)){
                $result[] = $_str;
            }
        }
    }
    
    return count($result)>0 ? $result[ count($result) - 1] : false;
}

function findnameinstring($str, $dict){

	$names = [];
	
	foreach($dict as $n){

		if(strlen($n)<3)
			continue;


		if(strpos($str, $n)!== false){
			$names[] = $n;
		}
	}

	

	$name = isset($names[0]) ? $names[0] : false;
}



function addRow2file($data, $part = 1){
	if(is_array($data)){
