		echo "ingore \r\n";
		continue;
	}
	
	$ve = new hbattat\VerifyEmail($email, 'admin@onlinedev.xyz');


	/**
	 * try to parse user name
	 */
	$str = explode('@',$email);
	$str = strtolower($str[0]);
	$str = str_replace(['-','.','-','_'], '', $str);

	$name = getnamefromstart($str, $dict);

	if($name == false){
		$name = findnameinstring($str, $dict);
	}
	

	$result = [
		$email,
		$ve->verify() ? 1 : 0,
		ucfirst($name)
	];

	addRow2file($result, $part);

	addItem2report($email);

	$cnt++;

	//count time
	$diff = microtime(true) - $starttime;

	$secPerItem = $diff / $cnt;
	$calcTime = round( ($secPerItem * ($total - $cnt) ) / 60);

	echo round( (100/$total) * $cnt,2 )."%" . ", Time left: ". $calcTime . "min. \r\n";
}

echo "Total: ".$cnt;
